      | 42847 -> { ItemTypeData.id= 42847; name= "Caldari Minokawa"; published= false; description= " The Amarr have decided that there's something to learn from the capsuleers when it comes to capital ships. I can't say as I disagree. I've been trying to tell the Navy this for years.  - remarks by Ishukone CEO Mens Reppola on the occasion of the Amarr-Caldari Capital Warfare Summit, YC118.01.15    A well established and close co-operation between Amarr and Caldari capital warfare tacticians and naval architects all but guaranteed that the Amarr would share their conclusions on the need to alter capital warfare doctrines and accommodate such changes with updated designs and new ship concepts.    The infusion of Amarr thinking on the subject of capital ship warfare served to break a long-standing impasse between doctrinal factions in the Caldari Navy's strategic command. The wisdom of learning from the example of the most experienced capital warfare pilots in New Eden was accepted and the Minokawa-class Force Auxiliary was the eventual result."; marketGroupId= None; groupId= 1805; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 1080000000.000000 }; { DogmaAttributeValueData.attributeId = 263; value= 300.000000 }; { DogmaAttributeValueData.attributeId = 264; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 300.000000 }; { DogmaAttributeValueData.attributeId = 267; value= 0.210000 }; { DogmaAttributeValueData.attributeId = 268; value= 0.310000 }; { DogmaAttributeValueData.attributeId = 269; value= 0.510000 }; { DogmaAttributeValueData.attributeId = 270; value= 0.410000 }; { DogmaAttributeValueData.attributeId = 271; value= 0.210000 }; { DogmaAttributeValueData.attributeId = 272; value= 0.310000 }; { DogmaAttributeValueData.attributeId = 273; value= 0.510000 }; { DogmaAttributeValueData.attributeId = 274; value= 0.410000 }; { DogmaAttributeValueData.attributeId = 665; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 15