      | 43623 -> { ItemTypeData.id= 43623; name= "♦ Osprey"; published= false; description= "In YC114 each major empire faction, having been embroiled in a harrowing, extensive, long-term war, recognized the growing need for support and logistics functionality in their vessels during the kind of protracted interstellar warfare that might otherwise prove exhausting for its participants. Both Frigate and Cruiser-class ships were put under the microscope, and in the Caldari State the outcome of the re-evaluation process led, among other developments, to a redesign and redeployment of the Osprey.    The Osprey originally offered excellent versatility and power for what was considered a comparably low price. After its redesign, its inbuilt mining technology - now a little creaky and long in the tooth - was gutted from the Osprey and replaced in its entirety with tech of a different type, capable of high energy and shield transfers."; marketGroupId= None; groupId= 1813; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 2496; value= 26500.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 11100000.000000 }; { DogmaAttributeValueData.attributeId = 263; value= 7745.923828 }; { DogmaAttributeValueData.attributeId = 264; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 1812.500000 }; { DogmaAttributeValueData.attributeId = 267; value= 0.425000 }; { DogmaAttributeValueData.attributeId = 268; value= 0.765000 }; { DogmaAttributeValueData.attributeId = 269; value= 0.637500 }; { DogmaAttributeValueData.attributeId = 270; value= 0.467500 }; { DogmaAttributeValueData.attributeId = 271; value= 0.265419 }; { DogmaAttributeValueData.attributeId = 272; value= 0.273438 }; { DogmaAttributeValueData.attributeId = 273; value= 0.328125 }; { DogmaAttributeValueData.attributeId = 274; value= 0.437500 }; { DogmaAttributeValueData.attributeId = 265; value= 1250.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 107000.000000 }; { DogmaAttributeVal